    me.onItemClick = function (item) {
        var gridPanel = Ext.getCmp('wlDataPanel');
        var name_value = item.code.split('@');
        var levelName = me.getLevelName(name_value[0]);
        if (levelName == null) {
            gridPanel.filters.clearFilters();
        } else {
            var filter = [{
                type: 'string',
                dataIndex: levelName,
                value: name_value[1]
            }];
            me.applyFilterToGrid(gridPanel, filter);
        }
    };

    me.applyFilterToGrid = function (grid, filter) {
        grid.filters.clearFilters();
        grid.filters.filter;
        grid.filters.addFilters(filter);
    }

    me.getLevelText = function (text) {
        if (text == 'All Districts') {
            return 'punjab';
        }
        if (text == 'All Tehsils') {
            return 'district';
        }
        if (text == 'All Qanungoi Halqas') {
            return 'tehsil';
        }
        if (text == 'All Patwar Circles') {
            return 'qanongo_halka';
        }
        if (text == 'All Mauzas') {
            return 'patwar_circle';
        } else {
            return text;
        }
    }

    me.getLevelName = function (level) {
        if (level == 'district') {
            return 'district';
        }
        if (level == 'tehsil') {
            return 'tehsil';
        }
        if (level == 'qanungoi') {
            return 'qanongo_halka';
        }
        if (level == 'patwar') {
            return 'patwar_circle';
        }
        if (level == 'mauza') {
            return 'mauza';
        } else {
            return null;
        }
    }

